import { Link } from "react-router-dom";
import useAuth from "./hooks/useAuth";
const Navbar = () => {
  const { auth } = useAuth();
  return (
    <nav className="navbar">
      <Link to="/">
        <h1>Exam.com</h1>
      </Link>
      <div className="links">
        <Link to="/login">Login</Link>
        <Link to="/">Exams</Link>
        {auth?.role === "teacher" ? (
          <Link to="/create">Exam Create</Link>
        ) : (
          <p></p>
        )}

        <Link to="/register">User Create</Link>
        <p>Hello, {auth?.user}</p>
      </div>
    </nav>
  );
};

export default Navbar;
